import Rapyd from './Rapyd';

class Editor extends Rapyd {
  target;
  editorId;

  constructor(target, editorId) {
    super();

    this.target = target;
    this.editorId = editorId;

    this.init();
  }

  calcNumbers() {
    var content = document
      .getElementById(`${this.editorId}_editor`)
      .value.split("\n");

    var newContent = [];

    if (content.length < 10) {
      content.length = 10;
    }

    for (var i = 0; i < content.length; i++) {
      newContent.push(`<p>${i + 1}</p>`);
    }

    document.getElementById(
      `${this.editorId}_numbers`
    ).innerHTML = newContent.join("");
  }

  SetBody(value) {
    this.renderHtml(`#${this.editorId}_display`, value);
    this.calcNumbers();
  }

  init() {
    const content = `<div id="${this.editorId}_display" class="flex-1 ml-4"></div>
  <div id="${this.editorId}_wrapper" class="flex-1 relative flex bg-grene-600 text-sm border border-gray-800 shdaow leading-loose">
    <div id="${this.editorId}_numbers" class="p-2 text-center bg-gray-100 border-r border-gray-800"></div>
    <textarea id="${this.editorId}_editor" class="flex-1 p-2 outline-none"><div class="min-h-screen bg-gray-200 flex justify-center items-center">
   <div class="bg-white border-2 border-gray-300 p-6 rounded-md tracking-wide shadow-lg">

      <div class="flex items-center mb-4">
         <img alt="avatar" class="w-20 rounded-full border-2 border-gray-300"
                          src="https://picsum.photos/seed/picsum/200" />

         <div id="header-text" class="leading-5 ml-6 sm">
            <h4 id="name" class="text-xl font-semibold">Rapyd Tailwind Text Editor</h4>
            <h5 id="job" class="font-semibold text-blue-600">Build By Michael Curtis</h5>
         </div>

      </div>

      <div>
         <q class="italic text-gray-600">Inspired By <span class="text-blue-600">Brian Ellis</span></q>
      </div>

   </div>
</div></textarea>
  </div>`;

    this.renderHtml(this.target, content);

    this.calcNumbers();

    const editor = document.getElementById(`${this.editorId}_editor`);

    editor.addEventListener("keydown", function (e) {
      if (e.key == "Tab") {
        e.preventDefault();
        var start = e.target.selectionStart;
        var end = e.target.selectionEnd;

        e.target.value =
          e.target.value.substring(0, start) +
          "\t" +
          e.target.value.substring(end);

        e.target.selectionStart = e.target.selectionEnd = start + 1;
      }
    });

    editor.addEventListener(
      "keyup",
      function (e) {
        this.SetBody(e.target.value);
      }.bind(this)
    );

    this.SetBody(editor.value);
  }
}

